(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d20f7d5"],{b49f:function(t){t.exports=JSON.parse('{"name":"Combinatorics","description":"","items":[{"tags":[{"name":"combinatorics","url":"/tags/combinatorics"},{"name":"number theory","url":"/tags/number-theory"}],"title":"HNOI-2009 有趣的数列","excerpt":"我们称一个长度为 $2n$ 的数列是有趣的，当且仅当该数列满足以下三个条件：","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/combinatorics/catalan-numbers/luogu-3200"},{"tags":[{"name":"combinatorics","url":"/tags/combinatorics"},{"name":"probability","url":"/tags/probability"}],"title":"TJOI-2015 概率论","excerpt":"为了提高智商，ZJY 开始学习概率论。有一天，她想到了这样一个问题：对于一棵随机生成的 $n$ 个结点的有根二叉树（所有互相不同构的形态等概率出现），它的叶子节点数的期望是多少呢？","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/combinatorics/catalan-numbers/luogu-3978"},{"tags":[{"name":"combinatorics","url":"/tags/combinatorics"}],"title":"AHOI-2012 树屋阶梯","excerpt":"暑假期间，小龙报名了一个模拟野外生存作战训练班来锻炼体魄，训练的第一个晚上，教官就给他们出了个难题。由于地上露营湿气重，必须选择在高处的树屋露营。小龙分配的树屋建立在一颗高度为 $N+1$ 尺（$N$ 为正整数）的大树上，正当他发愁怎么爬上去的时候，发现旁边堆满了一些空心四方钢材（如图1.1），经过观察和测量，这些钢材截面的宽和高大小不一，但都是 $1$ 尺的整数倍，教官命令队员们每人选取 $N$ 个空心钢材来搭建一个总高度为 $N$ 尺的阶梯来进入树屋，该阶梯每一步台阶的高度为 $1$ 尺，宽度也为 $1$ 尺。如果这些钢材有各种尺寸，且每种尺寸数量充足，那么小龙可以有多少种搭建方法？（注：为了避免夜里踏空，钢材空心的一面绝对不可以向上。）","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/combinatorics/catalan-numbers/luogu-2532"},{"tags":[{"name":"combinatorics","url":"/tags/combinatorics"}],"title":"HNOI-2004 树的计数","excerpt":"一个有 $n$ 个节点的树，设它的节点分别为 $v_1,v_2,\\\\ldots,v_n$，已知第 $i$ 个节点 $v_i$ 的度数为 $d_i$，问满足这样的条件的不同的树有多少棵。","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/combinatorics/prufer/luogu-2290"}],"url":"/tags/combinatorics"}')}}]);
